import Header from './components/Header';
import {Button} from 'reactstrap';
import  {ToastContainer, toast} from 'react-toastify';
function App() {
  const btnhandle =()=>{
    // toast("this is my first message")
    toast.success("DONE!")
    position : "top-center"
  };
  return (
    <div>
      <ToastContainer />
        <Header />
        <Button color="primary" outline onClick={btnhandle}>My Button</Button>
      </div>
  );
}

export default App;
